if(r)q="Bug\xfcn ar\u0131nd\u0131r\u0131c\u0131 ve dinlendirici enerjiler \xfczerine ak\u0131yor. \xd6zellikle kayg\u0131lar\u0131ndan uzakla\u015faca\u011f\u0131n ve Ametist ta\u015f\u0131n\u0131n umursamazl\u0131k seviyeni y\xfckseltece\u011fi rahat bir g\xfcn ge\xe7ireceksin. Etraf\u0131nda olan \xf6nemli olaylar\u0131 g\xf6z ard\u0131 etme. Tabi di\u011fer yandan b\xfct\xfcn olaylara bu enerji sayesinde so\u011fukkanl\u0131l\u0131kla yakla\u015fabilece\u011fini de unutma."
