if(r==="1")r="  Bu g\xfcnlerde ruhsal a\xe7\u0131dan kendini karars\u0131z hissedebilirsin. Dini y\xf6nden kaybolmaya ve inan\xe7lar\u0131n\u0131 sorgulamaya ba\u015flayaca\u011f\u0131n bir d\xf6neme giriyorsun. \xd6zellikle bu d\xf6nemlerde uzun soluklu sorgulamalardan ka\xe7\u0131nmal\u0131, dini sohbetlere \xe7ok dahil olmamal\u0131s\u0131n. Bu sohbetler seni as\u0131l inan\xe7lar\u0131ndan uzakla\u015ft\u0131rabilir ve uzun s\xfcre manevi boyuttan soyutlayabilir.\n\t\n  Bu gibi d\xf6nemlerde sana tavsiyem; neye inand\u0131\u011f\u0131n\u0131 ya da neye g\xfcvendi\u011fini, eski hayat\u0131ndan ald\u0131\u011f\u0131n dersleri de hesaba katarak ke\u015ffetmendir.\n\t\n  \u0130\u015f hayat\u0131n ile ilgili baz\u0131 \xe7\u0131kmazlara girebilirsin. Burada da karars\u0131zl\u0131k ve s\u0131k\u0131nt\u0131lar biraz seni kovalayabilir. \xd6zellikle fevri kararlar vermemeye, verdi\u011fin kararlar i\xe7in uzun uzun d\xfc\u015f\xfcnd\xfc\u011f\xfcnden emin olmaya ihtiyac\u0131n var.\n\t\n  G\xfc\xe7l\xfc bir karaktere sahip olmak do\u011fu\u015ftan da gelebilir, sonradan da kazan\u0131labilir. Zay\u0131f olmak tamamen insan\u0131n tembellik ya da baz\u0131 d\u0131\u015f etkenler nedeniyle bireysel tercihidir. Bu d\xf6nemde b\xf6yle konularla ba\u015fa \xe7\u0131kmak i\xe7in dik durmal\u0131 ve ad\u0131mlar\u0131n\u0131 sa\u011flam atmal\u0131s\u0131n.\n"
else if(r==="2")r="  Bu kart bu g\xfcnlerde kendi ba\u011f\u0131ms\u0131zl\u0131\u011f\u0131na ve kendi kararlar\u0131na, \xe7evrendekilere g\xf6re daha fazla \xf6nem verdi\u011fini anlatmaktad\u0131r.\n\t\n  \xd6zg\xfcvenindeki sa\u011flaml\u0131k baz\u0131 ki\u015fileri \u015fa\u015f\u0131rtabilir. \xd6zellikle i\u015f ortam\u0131nda kendinden emin olman ve olgun tav\u0131rlar\u0131nla ba\u015far\u0131y\u0131 yakalayabilirsin.\n\t\n  Buna ek olarak sevdi\u011fin ki\u015filere kar\u015f\u0131 biraz fazla korumac\u0131 ve sahiplenici olabilirsin. Bu durum kiminin \xe7ok ho\u015funa giderken, kimileri taraf\u0131ndan pek do\u011fru bulunmayabilir. Bu nedenle sevdi\u011fin ki\u015filere kar\u015f\u0131 olan tavr\u0131n\u0131 belirlerken, kar\u015f\u0131ndaki ki\u015fileri \xf6l\xe7\xfcp tartmay\u0131 en do\u011fru \u015fekilde yapmal\u0131s\u0131n.\n\t\n  Bu aralar tecr\xfcbelerinden faydalanmak isteyen ki\u015filer olabilir. Bunlar\u0131 payla\u015fmaktan sak\u0131n \xe7ekinme. \xd6nemli olan do\u011fru bilgilerin do\u011fru ki\u015filere aktar\u0131ld\u0131\u011f\u0131ndan emin olmak. Vicdan\u0131na kulak vermeyi hayat\u0131n\u0131n hi\xe7bir noktas\u0131nda b\u0131rakmamal\u0131s\u0131n.\n"
else if(r==="3")r="  Yak\u0131n zamanda verece\u011fin kararlarda, ufak tefek korkular nedeni ile hata yapabilirsin. Kararlar\u0131n\u0131 verirken olumsuz taraflar\u0131ndan \xe7ok olumlu taraflar\u0131n\u0131 d\xfc\u015f\xfcnmeli ve kararlar\u0131na negatif etkisi olaca\u011f\u0131n\u0131 d\xfc\u015f\xfcnd\xfc\u011f\xfcn insanlar\u0131n fikirlerini almaktan ka\xe7\u0131nmal\u0131s\u0131n.\n\t\n  Seninle, \xe7\u0131karlar\u0131 i\xe7in sahte arkada\u015fl\u0131k yapanlar\u0131n etraf\u0131na toplanaca\u011f\u0131 bir d\xf6neme giriyorsun. Arkada\u015f se\xe7imlerinde dikkatli olmal\u0131s\u0131n. Sana \xe7ok iyi gibi g\xf6r\xfcn\xfcp ve davran\u0131p seni manip\xfcle etmeye \xe7al\u0131\u015fan bir \xe7ok ki\u015fi ile kar\u015f\u0131 kar\u015f\u0131ya gelebilirsin. \xd6nemli olan g\xfcvendi\u011fin ve bildi\u011fin insanlardan \u015fa\u015fmamak.\n\t\n  D\u0131\u015f g\xf6r\xfcn\xfc\u015f\xfcnle dikkat \xe7ekiyorsun. Materyalizm merkezli d\xfc\u015f\xfcnceye sahip kimselerin hedefi haline gelmek bu aralar ba\u015f\u0131na gelebilecek durumlardan biri. Hayat\u0131na yeni ald\u0131\u011f\u0131n ya da tan\u0131d\u0131\u011f\u0131n\u0131 d\xfc\u015f\xfcn\xfcp ku\u015fkuda kald\u0131\u011f\u0131n insanlarla biraz daha tan\u0131\u015fma \xe7al\u0131\u015fmas\u0131 yapmal\u0131s\u0131n.\n"
else if(r==="4")r="  Bu kart, bu aralar manevi anlamda ne kadar g\xfc\xe7l\xfc oldu\u011funu g\xf6steriyor. Etraf\u0131na sevgi ile ilgili \xf6nemli dersler vermen gerekebilir. \n\t\n  Olduk\xe7a \xf6zel ve g\xfc\xe7l\xfc bir kalbe sahipsin. Bu sevgiyi kullanmak isteyenler \xe7\u0131ksa da onlardan bir \xe7\u0131rp\u0131da kurtulacaks\u0131n. Korkular\u0131nla ve kompleksleri ile y\xfczle\u015fip bunlardan ar\u0131narak ne kadar sa\u011flam durdu\u011funu herkese g\xf6sterece\u011fin bir d\xf6nemdesin.\n\t\n  \xd6zellikle k\xf6t\xfc enerjilere sahip kimseler taraf\u0131ndan ders konusu olacaks\u0131n. Hatta senden \xf6\u011frendikleri nedeni ile sana te\u015fekk\xfcr etmek isteyenler bile \xe7\u0131kabilir.\n"
else if(r==="5")r="  Fark\u0131ndal\u0131klar\u0131n\u0131n artaca\u011f\u0131 ve olgunla\u015faca\u011f\u0131n bir d\xf6nemin kap\u0131lar\u0131n\u0131 aral\u0131yorsun. \xd6zellikle isteklerini, arzular\u0131n\u0131 ve daha da \xf6nemlisi sorumluluklar\u0131n\u0131n fark\u0131ndal\u0131\u011f\u0131 artacak.\n\t\n  Ba\u015far\u0131 merdivenlerini yava\u015f yava\u015f \xe7\u0131kmay\u0131 b\u0131rak\u0131p bir anda y\xfckseli\u015fe ge\xe7menin zaman\u0131 geldi. \u0130\u015f veya sosyal hayat farketmeksizin, ba\u015far\u0131 dolu g\xfcnler seni bekliyor.\n\t\n  Planlar\u0131n\u0131 hayata ge\xe7irmek i\xe7in \xf6nemli ad\u0131mlar atmay\u0131 d\xfc\u015f\xfcn\xfcyorsun. Bu d\xf6nemde bunun i\xe7in olduk\xe7a uygun bir d\xf6nem. Sorumluluklar\u0131n\u0131 yerine g\xf6re art\u0131r\u0131p azaltabilir, kapasitene g\xf6re hareket ederek \xe7evrendeki insanlara kar\u015f\u0131 olgun bir tav\u0131r sergileyebilirsin.\n\t\n  Ayr\u0131ca yak\u0131n zamanda seyahate \xe7\u0131kabilirsin. Bence \u015fimdiden haz\u0131rl\u0131klara ba\u015fla.\n"
else if(r==="6")r="  Ay kart\u0131 olumlu bir kart de\u011fil. Dikkatli olmal\u0131s\u0131n.\n\t\n  Etraf\u0131nda sana oyunlar oynayan ve arkandan i\u015f \xe7eviren yak\u0131n sand\u0131\u011f\u0131n arkada\u015flar\u0131n olabilir. G\xf6z\xfcn\xfc d\xf6rt a\xe7mal\u0131s\u0131n.\n\t\n  Ya da aldat\u0131lman\u0131n e\u015fi\u011finde olabilirsin. Bunlar\u0131n tamam\u0131 i\xe7in \xf6nlem alman\u0131n tam zaman\u0131.\n\t\n  \u0130\xe7inden gelen sese kulak ver ve hislerine g\xfcvenerek hareket etmeye ba\u015fla. \xc7\xfcnk\xfc bu kart ayn\u0131 zamanda telepati kart\u0131d\u0131r. G\xf6rd\xfc\u011f\xfcn r\xfcyalar aras\u0131nda ger\xe7ek ve sahteyi ay\u0131rt etmeye ba\u015flayabilirsin.\n\t\n  Yak\u0131n zamanda gelecek k\xf6t\xfc bir haber seni \xfczebilir. Ancak ask\u0131n korkma, ay kart\u0131n\u0131n enerjisi etraf\u0131na negatiflikleri toplasa da bunlara kar\u015f\u0131, yak\u0131nlar\u0131nda G\xfcne\u015f ta\u015f\u0131 bulundurarak enerjini yenileyebilirsin.\n\t\n  \u0130\u015f hayat\u0131nda g\xfcvendi\u011fin birileri taraf\u0131ndan ihanete u\u011frayabilirsin. B\xfct\xfcn bu olumsuzluklara kar\u015f\u0131 dik durmal\u0131 ve enerjini d\xfc\u015f\xfcrerek di\u011fer k\xf6t\xfc olaylar\u0131 da \xe7a\u011f\u0131rmad\u0131\u011f\u0131ndan emin olmal\u0131s\u0131n.\n"
else if(r==="7")r="  Duygusall\u0131\u011f\u0131n ba\u015flad\u0131\u011f\u0131 bir d\xf6neme girebilirsin. \xd6zellikle yak\u0131nlarda alaca\u011f\u0131m g\xfczel bir haberle g\xf6z ya\u015flar\u0131na hakim olamayacak gibi duruyorsun. \n\t\n  Bu kart ayn\u0131 zamanda a\u015fk\u0131n habercisidir. A\u015fk ile ilgili hayat\u0131nda yeni geli\u015fmeler olacak. Yeni bir a\u015fka ba\u015flayabilir ya da mevcuttaki a\u015fk hayat\u0131nda g\xfczel geli\u015fmeler ya\u015fanabilir.\n\t\n  Ayr\u0131ca bu d\xf6nemde biraz kendini sorgulay\u0131p tan\u0131maya \xe7al\u0131\u015fabilirsin. Kendi kendine sordu\u011fun sorulara d\xfcr\xfcst bir \u015fekilde yan\u0131t verdi\u011finden mutlaka emin olmal\u0131s\u0131n.\n"
else if(r==="8")r="  Bu aralar mevcut i\u015finden s\u0131k\u0131l\u0131p yeni i\u015f ve u\u011fra\u015f aray\u0131\u015flar\u0131na girebilirsin. \xc7\xfcnk\xfc bu kart me\u015fguliyet kart\u0131d\u0131r. Ancak bu aray\u0131\u015fta elindeki de\u011ferleri kaybetmedi\u011finden emin olmal\u0131s\u0131n.\n\t\n  Teknoloji ve matematiksel konularda daha a\xe7\u0131k ve ilgili bir d\xf6neme giriyorsun. Kafandaki projeleri hayata ge\xe7irmek i\xe7in ad\u0131mlar atmaya ba\u015flayacaks\u0131n.\n\t\n  Daha analitik ve somut d\xfc\u015f\xfcnmeye ba\u015flayaca\u011f\u0131n bir d\xf6nemde etraf\u0131ndaki duygusal olu\u015fumlar\u0131 yok etmemeye \xe7al\u0131\u015f. Tamamen matematik zekas\u0131 ile ilerlemek ve kararlar\u0131 buna g\xf6re vermek \xe7ok ak\u0131ll\u0131ca olmayabilir.\n"
else if(r==="9")r="  Hayat g\xf6r\xfc\u015f\xfcnde ve bak\u0131\u015f a\xe7\u0131nda farkl\u0131l\u0131klar ve daha anlay\u0131\u015f dolu bir d\xf6neme giriyorsun.\n\t\n  \xd6zellikle etraf\u0131nda olan ve \xe7ok onaylamad\u0131\u011f\u0131n olaylara daha \u0131l\u0131ml\u0131 yakla\u015fmaya ba\u015flayacaks\u0131n. \xc7evren taraf\u0131ndan da bu fark edilecek ve bunlar\u0131n kar\u015f\u0131l\u0131\u011f\u0131n\u0131 g\xfczel bir \u015fekilde alabileceksin.\n\t\n  Sab\u0131r bu aralar hayat\u0131n\u0131n merkezinde bulunuyor. Baz\u0131 ki\u015filere ve olaylara kar\u015f\u0131 daha dayan\u0131kl\u0131 oldu\u011funu g\xf6receksin. Senin bile \u015fa\u015f\u0131raca\u011f\u0131n sakinlikte tepkilerle olaylara yakla\u015f\u0131m\u0131n \xe7evrenin de dikkatini \xe7ekecek.\n"
else if(r==="10")r="  Bu d\xf6nem, b\xfct\xfcn zorluklar\u0131n \xfcstesinden geldi\u011fin ve zorluklara kar\u015f\u0131 verdi\u011fin m\xfccadelelere pozitif yan\u0131tlar alaca\u011f\u0131n bir d\xf6nem.\n\t\n  \xd6zellikle bir \xe7ok kavga ve s\u0131k\u0131nt\u0131dan zaferle \xe7\u0131kaca\u011f\u0131n g\xf6r\xfcn\xfcyor. Ald\u0131\u011f\u0131n kararlar\u0131n arkas\u0131nda durup ayaklar\u0131n\u0131 yere sa\u011flam basarak zaferinin tad\u0131n\u0131 \xe7\u0131karacaks\u0131n.\n\t\n  \u0130steklerini ve duygular\u0131n\u0131 kontrol alt\u0131nda tutabiliyorsun. \xd6zellikle son zamanlarda ya\u015fad\u0131\u011f\u0131n bir duygusal \xe7\xf6k\xfcnt\xfcn\xfcn ard\u0131nda b\u0131rakt\u0131\u011f\u0131 izleri bu d\xf6nemde temizleyecek. Yenilenen ve kontrol edilebilen enerjinle daha iyi bir zamana ba\u015flayabileceksin.\n\t\n  Maddi anlamda da baz\u0131 s\u0131k\u0131nt\u0131lar\u0131n\u0131n giderildi\u011fini g\xf6rebilirsin.\n"
else if(r==="11")r="  Bu kart her ne kadar k\xf6t\xfc gibi dursada asl\u0131nda k\xf6t\xfcl\xfcklerin \xf6l\xfcm\xfc ile ilgili bir kartt\u0131r.\n\t\n  Yak\u0131n zamanda eski hayat\u0131n\u0131 geride b\u0131rak\u0131p, duygusall\u0131ktan kurtulup, daha g\xfczel bir ba\u015flang\u0131\xe7 i\xe7in ad\u0131mlar atacaks\u0131n.\n\t\n  Uzun s\xfcredir bekledi\u011fin g\xfczel hayata ba\u015flamak i\xe7in \xf6n\xfcndeki engelleri kald\u0131r\u0131p bir kenara at\u0131yorsun. \xd6zellikle duygusall\u0131\u011f\u0131n\u0131n yerini daha olgun ve pozitif duygular al\u0131yor.\n\t\n  Hayat\u0131ndaki bu de\u011fi\u015fiklikler seni ve \xe7evreni olumlu y\xf6nde etkileyecek ve daha mutlu bir hayata ge\xe7i\u015f yapacaks\u0131n.\n\t\n  Pozitif duygularla i\xe7ini doldurmay\u0131 sak\u0131n unutma. Evren seni her zaman dinliyor.\n"
else if(r==="12")r="  Yak\u0131n zamanda arzulad\u0131\u011f\u0131n \u015feylere ula\u015fmak i\xe7in h\u0131rsla m\xfccadele verdi\u011fin bir d\xf6neme gireceksin.\n\t\n  \xd6zellikle Moda sekt\xf6r\xfcnde ya da serbest bir i\u015fte elde etmek istedi\u011fin bir ba\u015far\u0131 \xfczerine \xe7\u0131kt\u0131\u011f\u0131n yolculukta duygular\u0131n\u0131 ve h\u0131rslar\u0131n\u0131 kontrol edemeyece\u011fin zamanlar ge\xe7irebilirsin.\n\t\n  Duygular\u0131n\u0131 kontrol etmen bu d\xf6nemde olduk\xe7a \xf6nemli. H\u0131rs g\xfc\xe7l\xfc bir duygudur. E\u011fer kontrol edemezsen hatalara s\xfcr\xfckleyebilir.\n"
else if(r==="13")r="  Bu kart, s\u0131cak tav\u0131rlar\u0131nla \xe7evreni etkileyece\u011fin ve maceralara \xe7\u0131kaca\u011f\u0131n bir d\xf6neme girdi\u011fini g\xf6steriyor.\n\t\n  \u0130\xe7inden s\u0131rf e\u011flence i\xe7in insanlara sata\u015fmak, tart\u0131\u015fmak ve \u015fakalar yapmak gelebilir. \xc7\xfcnk\xfc bu aralar enerjin bu y\xf6nde akmay\u0131 tercih edecek ve hayat\u0131nda pozitif farkl\u0131l\u0131klar yakalayacaks\u0131n.\n\t\n  Kimseye boyun e\u011fmek istemeyece\u011fin, sadece kendinin patronu olmak isteyece\u011fin bir zaman aral\u0131\u011f\u0131ndas\u0131n. Etraf\u0131ndaki insanlara kar\u015f\u0131 tav\u0131rlar\u0131na biraz dikkat etmen faydal\u0131 olabilir.\n\t\n  \xd6zellikle h\u0131rslar\u0131n\u0131 daha \xf6n plana getirip, istediklerini elde edene kadar \xe7abalamak as\u0131l gayelerinden biri olacak.\n"
else if(r==="14")r="  Zorluklar\u0131n \xfcstesinden kolayca geliyorsun. D\xfcr\xfcstl\xfck ve tarafs\u0131zl\u0131k sana \xe7evren taraf\u0131ndan olumlu yakla\u015f\u0131mlara neden olacak.\n\t\n  Tecr\xfcben ve olaylara yakla\u015f\u0131m\u0131n sebebiyle sana dan\u0131\u015fman isteyen baz\u0131 ki\u015filer olabilir. Onlar\u0131 bilgelikle kar\u015f\u0131la ve tecr\xfcbelerini mutlaka payla\u015f. Sana olan sayg\u0131lar\u0131ndaki de\u011fi\u015fimi sen de fark edeceksin.\n\t\n  Kariyerinde istedi\u011fin noktalara yakla\u015f\u0131p uzun uzun \xe7al\u0131\u015fmalar\u0131n\u0131n kar\u015f\u0131l\u0131\u011f\u0131n\u0131 bu aralar alabilirsin.\n"
else if(r==="15")r="  Her ne kadar fark\u0131nda olmasan da kendi kendinin en b\xfcy\xfck d\xfc\u015fman\u0131 haline geldi\u011fin bir d\xf6neme do\u011fru giriyorsun. \n  \n  Bu d\xf6nem, ruhun ihtiya\xe7lar\u0131 \xfczerinde kazan\u0131lan zihinsel oyunlar ve g\xfc\xe7l\xfcklerle sonu\xe7lanacakt\u0131r. \n  \n  Yak\u0131n ge\xe7mi\u015findeki sorunlar\u0131n tekrarlanmas\u0131 olas\u0131d\u0131r. Kendine ihanet etme durumu bu kart\u0131n en belirgin mesaj\u0131d\u0131r. Bu y\xfczden alaca\u011f\u0131n kararlarda \xe7ok dikkatli olmal\u0131s\u0131n. \n  \n  Kendine zarar vermemek i\xe7in, i\xe7inde bulundu\u011fun durumlara ve etraf\u0131ndakilere kar\u015f\u0131 biraz daha dikkatli olmal\u0131s\u0131n.\n"
else if(r==="16")r="  Bu kart sana mutlulu\u011fun kap\u0131lar\u0131n\u0131 a\xe7\u0131yor. Dileklerinin ger\xe7ekle\u015fece\u011fi, ne\u015fenin hayat\u0131n\u0131n merkezine oturaca\u011f\u0131 \xe7ok g\xfczel bir d\xf6neme giriyorsun.\n\t\n  Uzun s\xfcredir verdi\u011fin \xe7abalar\u0131n meyvesini alacak, istedi\u011fin ba\u015far\u0131lara ula\u015facaks\u0131n.\n\t\n  Bu bir ili\u015fki, i\u015f veya arkada\u015fl\u0131k olabilir.\n\t\n  Ya da daha da \xf6nemlisi. Uzun s\xfcredir devam eden sa\u011fl\u0131k sorunun sonunda d\xfczelmeye ba\u015flayacak.\n"
else if(r==="17")r="  Bu kart\u0131n tek amac\u0131 seni mutlulu\u011fa ula\u015ft\u0131rmakt\u0131r.\n\t\n  Bol kazan\xe7 ve sa\u011fl\u0131kla ilgili g\xfczel haberlerin al\u0131naca\u011f\u0131 g\xfczel bir d\xf6nemin ba\u015f\u0131ndas\u0131n.\n\t\n  Bu d\xf6nemde ya\u015famdan keyif almak i\xe7in elinde \xe7ok \xf6nemli kozlar olacak.\n"
else if(r==="18")r="  Biraz dinlenmek ve hedeflerine giden yolda ki \xe7abalar\u0131na biraz ara vermek i\xe7in do\u011fru bir zaman olabilir.\n\t\n  Geri \xe7ekilmeyi ifade eden bu kart, geride b\u0131rakt\u0131\u011f\u0131n d\xf6nemde ne kadar yoruldu\u011funu ve ara vermen gereken yerlerde bile devam edip kendini ne kadar yordu\u011funu g\xf6steriyor.\n\t\n  Ancak bunun sadece ge\xe7ici bir s\xfcre oldu\u011funu unutmamal\u0131s\u0131n.\n\t\n  Bu dinlenme seni sosyal hayattan soyutlanmaya kadar g\xf6t\xfcrebilir. Bu y\xfczden dozunu iyi ayarlad\u0131\u011f\u0131ndan emin olmal\u0131s\u0131n.\n"
else if(r==="19")r="  Daha \xf6nceki giri\u015fimlerin meyvesini bu d\xf6nemlerde yiyor olabilirsin. \xd6zellikle hedefledi\u011fin hayallerine ula\u015fm\u0131\u015f ya da ula\u015fmaya yakla\u015fm\u0131\u015fs\u0131n.\n\t\n  Ancak bekledi\u011fin daha \xf6nemli ve senin i\xe7in daha anlaml\u0131 b\xfcy\xfck \u015feyler var.\n\t\n  \u015eu an hen\xfcz ula\u015famad\u0131\u011f\u0131n ama yakla\u015ft\u0131\u011f\u0131n hayallerin i\xe7in bekleme d\xf6nemindesin. Yak\u0131n zamanda bu d\xf6nemin bitti\u011fi ve sorular\u0131na yan\u0131t bulaca\u011f\u0131n farkl\u0131 bir d\xf6neme ge\xe7i\u015f yapacaks\u0131n.\n\t\n  Bu aralar sab\u0131rl\u0131 olmak senin i\xe7in zor olsa da mutlulu\u011fun anahtar\u0131 olabilir.\n"
else if(r==="20")r="  E\u011fitimlere ba\u015flamak isteyece\u011fin bir d\xf6neme giriyorsun.\n\t\n  Bu kart senin e\u011fitime haz\u0131r oldu\u011funu ya da meslek hayat\u0131nda farkl\u0131 pozisyonlara ge\xe7mek i\xe7in ad\u0131mlar ataca\u011f\u0131n anlam\u0131na geliyor.\n\t\n  \xd6zellikle bu arada y\xfcksek mertebede insanlarla tan\u0131\u015fabilirsin. Burada kuraca\u011f\u0131n ili\u015fkilerin sa\u011flaml\u0131\u011f\u0131, ileride yapmak isteyece\u011fin de\u011fi\u015fiklikleri etkileyebilir. Bu nedenle bu ili\u015fkileri kurarken dikkat etmekte fayda var.\n\t\n  Farkl\u0131 pozisyonlara ge\xe7mek i\xe7in yeni ad\u0131mlar atacaks\u0131n. \u0130\u015f hayat\u0131ndaki de\u011fi\u015fimler ve gelecekle ilgili planlar\u0131n seni bile \u015fa\u015f\u0131rtabilir.\n\t\n  B\xfct\xfcn bu d\xfc\u015f\xfcnceler ve iyi kurulan ili\u015fkilerin sana katlanarak maddi kazan\xe7 olarak d\xf6nece\u011fini de s\xf6ylemeden ge\xe7meyelim.\n"
else if(r==="21")r="  G\xfc\xe7l\xfcklerle sava\u015fma d\xf6nemi geride kal\u0131yor.\n\t\n  Yak\u0131n zamanda ya\u015fad\u0131\u011f\u0131n k\xf6t\xfc veya k\xfc\xe7\xfck d\xfc\u015f\xfcr\xfcc\xfc bir olay\u0131n etkilerini atlatmak i\xe7in ad\u0131mlar atmaya ba\u015flayacaks\u0131n.\n\t\n  Bunlar\u0131n en \xf6nemlisi olaylar\u0131n merkezinden uzakla\u015fmak olacak. Bu uzakla\u015fma ger\xe7ek hayatta kar\u015f\u0131na fizikle ta\u015f\u0131nma ve ev de\u011fi\u015fikli\u011fi olarak da \xe7\u0131kabilir.\n\t\n  Yitirmedi\u011fin ve s\u0131ms\u0131k\u0131 tutundu\u011fun umutlar\u0131n\u0131n meyvesini bu d\xf6nemde yemeye ba\u015flayacaks\u0131n.\n"
else if(r==="22")r="  Kazan\xe7lar\u0131n\u0131n g\xfc\xe7le bulu\u015ftu\u011fu bu kart, yak\u0131n zamanda yapt\u0131\u011f\u0131n birikimlerin sonu\xe7lar\u0131n\u0131 alaca\u011f\u0131n\u0131 g\xf6stermektedir.\n\t\n  Ayn\u0131 zamanda seni sahiplenen ve sana de\u011fer veren bir ki\u015finin de g\xf6stergesidir.\n\t\n  Yak\u0131nlar\u0131n\u0131zda bulunan ya da yeni tan\u0131yaca\u011f\u0131n\u0131z bir ki\u015fi taraf\u0131ndan sahiplenici tav\u0131rlara \u015fahit olabilirsin. Ancak bu durum seni rahats\u0131z etmekten \xe7ok duygusal olarak tatmin edecektir.\n\t\n  Bencil ve kapal\u0131 g\xf6r\xfc\u015flere kar\u015f\u0131 iradeli tutumun da \xe7evrendeki bir \xe7ok ki\u015fiyi etkileyecek gibi duruyor.\n"
else if(r==="23")r="  Girdi\u011fin d\xf6nem heyecan ve \xf6nsezilerin g\xfc\xe7l\xfc duygular oldu\u011fu bir d\xf6nem olacak.\n\t\n  Olacak olaylar\u0131 \xf6nceden hissetme ve bu olaylara kar\u015f\u0131 g\xf6sterdi\u011fin heyecanla bunu \xf6nseziye d\xf6n\xfc\u015ft\xfcrme becerilerin bu d\xf6nemde olduk\xe7a y\xfckselecek.\n\t\n  Bunun yan\u0131 s\u0131ra bu aralar sanata biraz ilgi duyabilirsin. Seni rahatlatacak ve enerjini temizleyecek her t\xfcrl\xfc aktiviteye a\xe7\u0131k olmal\u0131s\u0131n.\n"
else if(r==="24")r="  Kalbinle ve duygular\u0131nla hareket etmektense bu aralar akl\u0131n\u0131n seni y\xf6nlendirmesine izin vereceksin.\n\t\n  Daha \xe7ok mant\u0131k kurarak att\u0131\u011f\u0131n ad\u0131mlarda, kimseye zarar vermedi\u011finden ve duygular\u0131n\u0131 incitmedi\u011finden emin olmal\u0131s\u0131n.\n\t\n  Kendine olan g\xfcveninde \xf6nemli oranda art\u0131\u015f olacak. \xd6zellikle ili\u015fkin varsa burada biraz fazla \xf6zg\xfcvenli olup kar\u015f\u0131layamayaca\u011f\u0131n s\xf6zler verebilirsin. Bu senin ileride k\xf6t\xfc bir konuma d\xfc\u015f\xfcrebilir. Bu y\xfczden verdi\u011fin s\xf6zlere ve s\xf6ylediklerine \xe7ok dikkat etmelisin.\n"
else if(r==="25")r="  Evinin dekorasyonunda ufak tefek de\u011fi\u015fiklikler yapmak isteyebilirsin. \u0130mparatori\xe7e kart\u0131 sende yarat\u0131c\u0131l\u0131k yeteneklerini biraz art\u0131rabilir.\n\t\n  Ancak bu kart\u0131n as\u0131l kar\u015f\u0131l\u0131\u011f\u0131 a\u015fkt\u0131r ve romantizmdir.\n\t\n  Yak\u0131n zamanda seni ger\xe7ek anlamda duygusal olarak tatmin edebilecek birini bulabilir ya da \u015fu anki sevgilinle evlilik ad\u0131mlar\u0131 atabilirsin.\n\t\n  A\u015fk ihtiyac\u0131n di\u011fer t\xfcm insanlarda oldu\u011fu gibi sende de g\xfcn y\xfcz\xfcne \xe7\u0131kacak ve biraz sevilmeye ihtiya\xe7 duyacaks\u0131n.\n\t\n  Ayr\u0131ca ekonomik \xf6zg\xfcrl\xfc\u011f\xfcne verdi\u011fin \xf6nem seni biraz yukar\u0131lara ta\u015f\u0131yabilir.\n"
else if(r==="26")r="  F\u0131rsat kart\u0131n\u0131 a\xe7t\u0131n. Yak\u0131n zamanda kap\u0131na gelecek \xe7ok \xf6nemli bir f\u0131rsat\u0131 do\u011fru de\u011ferlendirdi\u011finden emin olmal\u0131s\u0131n.\n\t\n  Bu f\u0131rsat senin yapaca\u011f\u0131n tercihlerle do\u011fru orant\u0131l\u0131 olarak hayat\u0131nda \xe7ok b\xfcy\xfck de\u011fi\u015fiklikler yapabilir.\n\t\n  Yeni ba\u015flang\u0131\xe7lar, i\u015f ile ilgili geli\u015fmeler ve sosyal hayat\u0131nda de\u011fi\u015fimlere \u015fahit olabilirsin.\n\t\n  Bu aralar kar\u015f\u0131na \xe7\u0131kacak f\u0131rsatlara dikkat etmelisin.\n"
else if(r==="27")r="  \u0130nsanlara kar\u015f\u0131 olan sevgini g\xf6sterirken biraz para harc\u0131yor olabilirsin.\n\t\n  Bu d\xf6nemde g\xfcc\xfcn ve \xe7al\u0131\u015fkanl\u0131\u011f\u0131n sayesinde kazan\xe7lar\u0131n\u0131 art\u0131racak, maddi anlamda g\xfc\xe7lenerek \xe7evrene biraz g\xf6steri\u015fli gelebilirsin.\n\t\n  Etraf\u0131nda sana sadece maddi g\xfc\xe7l\xfcl\xfc\u011f\xfcn y\xfcz\xfcnden yana\u015fan ki\u015filerin olmad\u0131\u011f\u0131na dikkat etmeli ve ger\xe7ek dostlar\u0131n\u0131 ay\u0131rt edebilmek i\xe7in dikkatli olmal\u0131s\u0131n.\n\t\n  Hatta bunun i\xe7in k\xfc\xe7\xfck oyunlar bile oynayabilirsin.\n\t\n  Gelenek ve g\xf6reneklerine bu aralar biraz \xf6nem vermen gerekebilir. Ailenle ge\xe7irdi\u011fin s\xfcrelerin kaliteli olmas\u0131na dikkat etmelisin.\n"
else if(r==="28")r="  \xc7evren taraf\u0131ndan fark ediliyor olmak ve aralar\u0131na kar\u0131\u015fmak yerine daha \xf6zg\xfcn olmak bu aralar merkezinde olacak.\n\t\n  Enerjinin y\xfckselece\u011fi ve daha \xf6nce yapmaya \xe7ekindi\u011fin \u015feylere cesaretle yakla\u015fma iste\u011fi seni tamamen sarabilir. Bu y\xfczden bu aralar bu cesaret ve enerjiyi kullanarak uzun s\xfcredir yapamad\u0131\u011f\u0131n \u015feyleri yapmak i\xe7in harekete ge\xe7me zaman\u0131.\n\t\n  Spora ba\u015flay\u0131p biraz kendinde g\xf6ze g\xfczel gelecek de\u011fi\u015fiklikler yapmak isteyeceksin. Bunu mutlaka yapmal\u0131s\u0131n.\n\t\n  Ayr\u0131ca risk alman\u0131 gerektirecek kararlar\u0131 verece\u011fin bir d\xf6neme giriyorsun. Alaca\u011f\u0131n risklerin kar\u015f\u0131l\u0131\u011f\u0131na de\u011fip de\u011fmedi\u011fi konusuna \xe7ok dikkat etmeli ve do\u011fru zamanda do\u011fru riskleri almal\u0131s\u0131n.\n"
else if(r==="29")r="  \u0130\xe7inden gelen seslere kulak verip alt\u0131nc\u0131 hislerine g\xfcvenmeye ba\u015flayaca\u011f\u0131n bir d\xf6neme giriyorsun.\n\t\n  Kurdu\u011fun a\u015fk ili\u015fkisinde ciddile\u015fme ve evlili\u011fe karar gitme karar\u0131 al\u0131yorsun. Bu d\xf6nemde eve ve e\u015fe ba\u011fl\u0131l\u0131k senin hayat merkezinde oluyor.\n\t\n  \xd6zellikle sadakat ve mutluluk i\xe7in hi\xe7 \xe7aba sarfetmeden i\xe7 sesini dinleyerek daha huzurlu bir hayat\u0131n ba\u015flang\u0131c\u0131na ad\u0131m at\u0131yorsun.\n"
else if(r==="30")r="  Bu kart bencillik ve iyi olmayan karakterlerin habercisidir.\n  \n  Bu aralar ad\u0131mlar\u0131n\u0131 d\xfc\u015f\xfcnerek atman ve \xe7evrendeki insanlar\u0131n duygular\u0131n\u0131 ikinci plana atmadan hareket etmen gerekiyor\n  \n  Kinci tutumlar ve kalp k\u0131rmak sana evrendeki k\xf6t\xfc enerjileri \xe7ekecektir. Bunun olmamas\u0131 i\xe7in ya\u015fad\u0131klar\u0131n\u0131 d\xfc\u015f\xfcn\xfcp ders \xe7\u0131karmak ve devam\u0131nda buna g\xf6re tav\u0131r almak senin i\xe7in faydal\u0131 olacakt\u0131r.\n  \n  Ayr\u0131ca bu kart ani bir biti\u015f ve k\xf6t\xfc haber kart\u0131d\u0131r. \u0130li\u015fkilerinde \xe7ok dikkatli ilerlemelisin.\n"
else if(r==="31")r="  Akl\u0131nda bir \xe7ok konuda soru var ve yan\u0131tlanmas\u0131n\u0131 bekliyorsun ancak yan\u0131tlanmad\u0131k\xe7a birikip tam bir karga\u015faya d\xf6n\xfc\u015f\xfcyor. Bunun bir an \xf6nce \xf6n\xfcne ge\xe7melisin.\n\t\n  Sorular\u0131n hepsini ayn\u0131 anda yan\u0131tlamaya \xe7al\u0131\u015ft\u0131\u011f\u0131n i\xe7in hi\xe7birine yan\u0131t bulam\u0131yorsun. Tek tek ilerlemelisin.\n\t\n  Hayat\u0131nda ani de\u011fi\u015fiklikler olabilir. Bu de\u011fi\u015fikliklerin seni negatif y\xf6nde etkilememesi i\xe7in kendini her t\xfcrl\xfc de\u011fi\u015fikli\u011fe kar\u015f\u0131 haz\u0131rlamal\u0131s\u0131n.\n\t\n  Alt\u0131nc\u0131 hissin bu aralar olduk\xe7a kuvvetli. Karar verirken i\xe7 sesini dinlemeli ve kararlar\u0131n\u0131 duygular\u0131ndan \xe7ok hissettiklerini \xf6n planda tutarak vermelisin.\n"
else if(r==="32")r="  Bu kart evlili\u011fin ve dengeli bir ili\u015fkinin kart\u0131d\u0131r. Yak\u0131n zamanda d\xfcnya evine gidebilir ya da uzun s\xfcrecek bir ili\u015fkiye ba\u015flayabilirsin.\n\t\n  \xd6zellikle bu aralar kendini \xe7ok iyi tan\u0131m\u0131\u015f olmal\u0131s\u0131n. \u0130steklerini ve arzular\u0131n\u0131 netle\u015ftirmeli, evrene verdi\u011fin mesajlar\u0131 net bir \u015fekilde vermelisin.\n\t\n  Bu kart \xf6zellikle ikizler burcuna adanm\u0131\u015ft\u0131r. Bu y\xfczden biraz mant\u0131k \xf6n plandad\u0131r ve u\u011furlu say\u0131 6 d\u0131r. Asl\u0131nda bu aralar verece\u011fin kararlarda mant\u0131\u011f\u0131n\u0131 \xf6n planda tutup buna g\xf6re ad\u0131m ataca\u011f\u0131n anlam\u0131na geliyor.\n"
else if(r==="33")r="  Bu kart tam olarak isminin anlam\u0131n\u0131 ta\u015f\u0131maktad\u0131r. Hayat\u0131nda ya\u015fad\u0131\u011f\u0131n zorluklar ve arada kald\u0131\u011f\u0131n se\xe7imlerde orta yolu bulmal\u0131 hayattaki dengeyi oturtmal\u0131s\u0131n.\n\t\n  \xd6zellikle bu aralar girdi\u011fin topluluklarda \xe7\u0131k\u0131nt\u0131 yaratacak tav\u0131rlar sergilememen olduk\xe7a \xf6nemli. \xc7\xfcnk\xfc tam olarak uyumlu olman gereken bir d\xf6nemdesin.\n\t\n  Zor ikilemlerde kalabilir karar vermekte zorlanabilirsin. Bu gibi durumlarda inan\xe7lar\u0131n\u0131 \xf6n planda tutmal\u0131s\u0131n. Ad\u0131mlar\u0131n\u0131 atarken vicdan\u0131n\u0131n rahat olmas\u0131 bu aralar \xe7ok \xf6nemli.\n"
else if(r==="34")r="  Hassas bir d\xf6neme giriyorsun. Sezgilerin ve duygular\u0131n \xe7ok g\xfc\xe7l\xfc olacak. Bunun art\u0131 yanlar\u0131n\u0131n yan\u0131 s\u0131ra eksi yanlar\u0131 da var.\n\t\n  Duygusal yo\u011funlu\u011fun oldu\u011fu d\xf6nemlerde kar\u015f\u0131ndaki ki\u015filere verdi\u011fin de\u011fer olmas\u0131 gerekenden biraz fazla olacak. Bu de\u011fer k\u0131ymet bilinmedi\u011finde seni normalden \xe7ok daha fazla duygusal \xe7\xf6k\xfcnt\xfclere sokabilir.\n\t\n  Bu nedenle kar\u015f\u0131ndaki ki\u015filere kar\u015f\u0131 tedbirli ve \xf6l\xe7\xfcl\xfc olmal\u0131s\u0131n.\n\t\n  Ayr\u0131ca sezgilerin olduk\xe7a g\xfc\xe7l\xfc olacak ancak sezgi ve kuruntu aras\u0131ndaki \xe7izgiyi \xe7ok iyi belirlemelisin.\n"
else if(r==="35")r="  Karmaya verdi\u011fin \xf6nemin artaca\u011f\u0131 bir d\xf6neme giriyorsun. Hayat\u0131n sana kar\u015f\u0131 olan d\xf6n\xfc\u015flerinden beklentilerini, yapt\u0131\u011f\u0131n hareketlere yans\u0131tacaks\u0131n.\n\t\n  Ancak bu kart hayat\u0131nda i\u015f, sosyal hayat, manevi hayat gibi bir\xe7ok konuya e\u015fit zaman ay\u0131rabilece\u011fini g\xf6steriyor. Yani isteklerini ger\xe7ekle\u015ftirmek i\xe7in bu aralar zaman\u0131n olacak. Kazanc\u0131n devam ederken sosyal ve \xf6zel hayat\u0131na da zaman ay\u0131rabileceksin.\n\t\n  Karars\u0131zl\u0131klar\u0131n\u0131n bir\xe7o\u011fu olumlu kararlarla sonlan\u0131yor. \xd6zellikle korktu\u011fun konularda risk almay\u0131 deneyecek ve sonu\xe7lar\u0131n\u0131 pozitif y\xf6nde alacaks\u0131n.\n"
else if(r==="36")r="  Ba\u015flad\u0131\u011f\u0131n projelere maddi yard\u0131mlar alabilirsin. Bu kart sana yard\u0131m gelece\u011fi ve do\u011fru orant\u0131da senin de yard\u0131m edece\u011fin anlam\u0131na geliyor.\n\t\n  Rutin bir mutluluk ve hayat i\xe7in maddi kazanc\u0131n yeterli gelmeye ba\u015flayacak. \xd6zellikle bu aralar biraz kabu\u011funa \xe7ekilmek isteyeceksin.\n\t\n  Kalabal\u0131k ve g\xfcr\xfclt\xfcl\xfc ortamla seni s\u0131kabilir ve biraz daha dura\u011fan bir ya\u015fama ge\xe7mek isteyebilirsin. Bu durumun ge\xe7ici ya da kal\u0131c\u0131 olup olmamas\u0131 tamamen sana ba\u011fl\u0131 olacak.\n"
else if(r==="37")r="  Bu d\xf6nemde \xe7evren taraf\u0131ndan k\u0131skan\u0131lmana sebep olacak ba\u015far\u0131lar elde edeceksin.\n\t\n  Gizlenmi\u015f yeteneklerin katlanarak artacak ve kimi insanlar taraf\u0131ndan \u015fa\u015fk\u0131nl\u0131kla kar\u015f\u0131lanacak.\n\t\n  G\xfc\xe7l\xfc bir karaktere sahip olaca\u011f\u0131n bu d\xf6nemlerde hem a\u015fk, hem i\u015f hayat\u0131nda y\xfcksek bir motivasyona sahip olacak, ba\u015far\u0131lar\u0131n\u0131n tereya\u011f\u0131ndan k\u0131l \xe7eker gibi oldu\u011funu g\xf6r\xfcnce sen bile \xe7ok \u015fa\u015f\u0131racaks\u0131n.\n\t\n  Ayn\u0131 zamanda tiyatro gibi sanatsal konulara e\u011filecek, kendini ifade etme konusunda hem sosyal hayatta hem de i\u015f hayat\u0131nda uzmanla\u015facaks\u0131n.\n"
else if(r==="38")r="  Y\xfcksek makamlara gelece\u011fin bir d\xf6neme giriyorsun. Bu kart \xf6zg\xfcven, g\xfc\xe7 ve sorumluluk kart\u0131d\u0131r. Bu kart\u0131 se\xe7tiysen e\u011fer kendin olan g\xfcvenini hemen art\u0131rmaya ba\u015fla.\n\t\n  Planlad\u0131\u011f\u0131n her \u015fey yava\u015f yava\u015f ger\xe7ekle\u015fmek \xfczere. \u0130yi enerjilerin sana do\u011fru akmas\u0131 ve planlar\u0131n \xfczerinde pozitif etki yaratmas\u0131 an meselesi.\n\t\n  Bu d\xf6nemde \xf6zellikle analitik bir kafa ile ilerleyeceksin. Kararlar\u0131n\u0131 verirken tamamen mant\u0131\u011f\u0131nla hareket edeceksin. Ancak bunu yaparken \xe7evrendeki insanlardan ve \xf6zellikle ilerde ihtiyac\u0131n olabilecek ki\u015filerden vazge\xe7medi\u011finden emin olmal\u0131s\u0131n.\n"
else if(r==="39")r="  Bu d\xf6nemde maneviyata verdi\u011fin \xf6nem art\u0131yor. \xd6zellikle duygusal enerjinde b\xfcy\xfck bir y\xfckseli\u015f var.\n\t\n  Ne yapt\u0131\u011f\u0131n\u0131 bilen ve zeki tav\u0131rlar\u0131nla \xe7evreni \xe7ok rahat etkiliyorsun. Hayat\u0131n anlam\u0131 konusunda bilin\xe7lenip ad\u0131mlar\u0131n\u0131 atarken kendinden emin bir \u015fekilde y\xfcr\xfcyorsun.\n\t\n  Sorumluluk sahibi yap\u0131nla hem i\u015f hem de sosyal hayat\u0131nda kimileri taraf\u0131ndan y\xfcceltilirken, sanata ve psikolojiye olan ilginle de bir\xe7ok insana hem yard\u0131m\u0131n dokunuyor hem de \xf6rnek tav\u0131rlar\u0131nla onlar\u0131 etkiliyorsun.\n"
else if(r==="40")r="  Yeni yetenekler ke\u015ffetmek i\xe7in uzun bir yolculu\u011fa ba\u015flayacaks\u0131n.\n\t\n  \xd6zellikle meditasyon yapmak ve iyi enerji toplamak konusunda uzmanla\u015facak gibi duruyorsun. Bu senin arzular\u0131n\u0131 ve d\xfc\u015flerini bekledi\u011finden \xe7ok daha \xe7abuk hayata ge\xe7iriyor.\n\t\n  Fiziksel sa\u011fl\u0131\u011f\u0131nda ciddi bir iyile\u015fme ve \xe7evreden gelecek olan zararlara kar\u015f\u0131 b\xfcy\xfck bir savunma olu\u015fturdu\u011funu g\xf6r\xfcyorum.\n\t\n  Pozitif d\xfc\u015f\xfcnce ve iyi ruh sahibi olmak i\xe7in bu d\xf6nemde harcad\u0131\u011f\u0131n \xe7aban\u0131n kar\u015f\u0131l\u0131\u011f\u0131n\u0131 g\xfczel bir \u015fekilde alacaks\u0131n.\n"
else if(r==="41")r="  Komik ve a\xe7\u0131k s\xf6zl\xfc insanlar\u0131 seviyorsun.\n\t\n  Ancak bu kart\u0131n as\u0131l anlam\u0131 e\u011fer oda\u011f\u0131n bir ki\u015fi de\u011fil de hayat\u0131nla ilgili bir hedefe ula\u015fmak ya da bir ba\u015far\u0131 ise yak\u0131nda g\xfczel haberler alaca\u011f\u0131n\u0131 s\xf6ylemek isterim.\n"
else if(r==="42")r="  Bu kart\u0131n genel anlamda mutluluk ve iyilik kart\u0131 oldu\u011funu s\xf6yleyebilirim.\n\t\n  \u0130\u015f ve e\u011fitimde ba\u015far\u0131, a\u015fk ve ailevi olaylarda huzur ve mutluluk seninle olacak.\n\t\n  Kart yeniden do\u011fu\u015fu anlat\u0131r. \xd6zellikle mutlu ve yeni bir hayata g\xfczel bir ad\u0131m at\u0131yorsun. Kariyerinde y\xfckseli\u015f ve a\u015fk hayat\u0131nda pozitif geli\u015fmeler olacak gibi duruyor.\n"
else if(r==="43")r="  Bu kart \xf6d\xfcllerin ve f\u0131rsatlar\u0131n habercisidir.\n\t\n  Yak\u0131n zamanlarda b\xfcy\xfck bir ba\u015far\u0131 elde edebilir ve kar\u015f\u0131l\u0131\u011f\u0131nda g\xfczel bir arma\u011fan kazanabilir ya da b\xfcy\xfck bir f\u0131rsat\u0131n kap\u0131lar\u0131n\u0131 a\xe7abilirsin.\n\t\n  Kar\u015f\u0131na \xe7\u0131kacak baz\u0131 olumsuz olaylar\u0131 kendi lehine \xe7evirip krizi f\u0131rsata \xe7evirebilirsin. \n"
else if(r==="44")r="  Bu kart sana yeni bir istek ve giri\u015fime ba\u015flayaca\u011f\u0131n\u0131n mesaj\u0131n\u0131 veriyor.\n\t\n  Cesaretini toplay\u0131p yapaca\u011f\u0131n bir giri\u015f, at\u0131laca\u011f\u0131n bir i\u015f ve yeni aray\u0131\u015flar belirecek. Bu aray\u0131\u015flarda ne istedi\u011fini  bilmek ve isteklerin do\u011frultusunda ilerleyebilmek olduk\xe7a \xf6nemli.\n\t\n  Bedenindeki enerjiyi de de\u011fi\u015ftirmek ve daha farkl\u0131 bir yo\u011funlu\u011fa ge\xe7mek isteyebilirsin.\n"
else if(r==="45")r="  \xc7abalar\u0131n\u0131n ve azminin meyvelerini art\u0131k yemeye haz\u0131rs\u0131n.\n\t\n  Asalar\u0131n Alt\u0131l\u0131s\u0131 sana hedefledi\u011fin ve u\u011frunda u\u011fra\u015f\u0131p \xe7abalad\u0131\u011f\u0131n bir ba\u015far\u0131ya ula\u015faca\u011f\u0131n\u0131n mesaj\u0131n\u0131 veriyor.\n\t\n  Azimli davran\u0131\u015f\u0131n ve emeklerinin kar\u015f\u0131l\u0131\u011f\u0131 yak\u0131n d\xf6nemde pozitif y\xf6nde seninle olacak.\n\t\n  \xd6zellikle son zamanlarda i\u015f hayat\u0131 veya sosyal hayat ile ilgili istedi\u011fin \xf6nemli bir hedef sonunda senin kar\u015f\u0131na gelecek.\n"
else if(r==="46")r="  Mant\u0131\u011f\u0131n\u0131n ve duygular\u0131n\u0131n ortak bir noktada bulu\u015ftu\u011fu ili\u015fkiler seni hem maddi hem de manevi rahatl\u0131\u011fa kavu\u015fturuyor.\n\t\n  Bu aralar mant\u0131\u011f\u0131n\u0131 duygular\u0131nla e\u015fde\u011fer \u015fekilde kullanmay\u0131  \xf6\u011frenip ili\u015fkilerini bu \u015fekilde kurmaya ba\u015fl\u0131yor gibisin.\n\t\n  Bu durum seni ciddi anlamda tatmin edecek ancak ilerde ya\u015fayabilece\u011fin mental bo\u015flu\u011fa d\xfc\u015fmemek i\xe7in \u015fimdiden \xf6nlem alman senin i\xe7in faydal\u0131 olabilir.\n"
else if(r==="47")r="  Yak\u0131n zamanlarda senin i\xe7in \xe7ok de\u011ferli birini \xfczebilirsin. Bu derin pi\u015fmanl\u0131klara ve do\u011fru orant\u0131l\u0131 olarak kendi \xfcz\xfcnt\xfcne sebebiyet vermene neden olacak.\n\t\n  Bu kart\u0131n bir di\u011fer anlam\u0131 ise sevdi\u011fin ve istedi\u011fin birini elde etmektir. Ancak bunu yaparken birileri taraf\u0131ndan y\xf6nlendirilebilir ve hile kullanabilirsin. Bunu yapmak ilerde yine evren taraf\u0131ndan sana olumsuz olarak geri d\xf6nebilir. Buna \xe7ok dikkat etmelisin.\n\t\n  Negatif enerjileri ve k\xf6t\xfc niyetli ki\u015fileri mutlaka kendinden uzakla\u015ft\u0131rmal\u0131s\u0131n.\n"
else if(r==="48")r="  Hi\xe7 ummad\u0131\u011f\u0131n bir olumsuzluk veya ba\u015far\u0131s\u0131zl\u0131k birden kar\u015f\u0131na \xe7\u0131kabilir.\n\t\n  Bu kart seni kar\u015f\u0131na \xe7\u0131kabilecek olumsuzluklar ile ilgili uyar\u0131yor. Bir plana ba\u015flarken mutlaka dikkatli ve emin ad\u0131mlarla ilerlemelisin.\n\t\n  \xc7\xfcnk\xfc bu ya\u015fanan olumsuzluk ya da ba\u015far\u0131s\u0131zl\u0131k bir d\u0131\u015f etken kaynakl\u0131 olabilece\u011fi gibi senin plans\u0131z ve hatal\u0131 davran\u0131\u015flar\u0131n nedeniyle de olabilir.\n"
else if(r==="49")r="  Karars\u0131zl\u0131\u011f\u0131n h\xfck\xfcm s\xfcrece\u011fi, kendi \xf6z kontrol\xfcn\xfc bir s\xfcreli\u011fine ba\u015fkas\u0131n\u0131n eline b\u0131rakmaya \xe7al\u0131\u015faca\u011f\u0131n bir d\xf6nemin kap\u0131lar\u0131n\u0131 aralad\u0131n.\n\t\n  Karars\u0131zl\u0131klar\u0131n\u0131n kayna\u011f\u0131, daha \xf6nceki kararlar\u0131nda yer alan b\xfcy\xfck h\u0131rs\u0131n\u0131n kar\u015f\u0131l\u0131\u011f\u0131n\u0131 alamam\u0131\u015f olman da olabilir. Yani asl\u0131nda korkuyor olman.\n\t\n  Bu d\xf6nemde ba\u015fkalar\u0131n\u0131n seni y\xf6nlendirmesine biraz m\xfcsaade edebilirsin. Bu biraz yorgunlukla da ilgili olacak. \xc7\xfcnk\xfc se\xe7imlerini yap\u0131p hayat\u0131n\u0131 d\xfczende ilerletmek biraz seni yoruyor gibi.\n"
else if(r==="50")r="  Bu d\xf6nemde biraz yaln\u0131z kalmaya, kafa dinlemeye, evde oturmaya hatta yak\u0131nlar\u0131nda varsa biraz bah\xe7e i\u015fleriyle u\u011fra\u015fmanda fayda var.\n\t\n  Bunlar sana \xe7ok farkl\u0131 gelebilir ancak \xf6zellikle bah\xe7e ile u\u011fra\u015f\u0131rken elini topra\u011fa de\u011fdirdi\u011fin anda sana ne kadar iyi geldi\u011fini anlayacaks\u0131n. Yak\u0131nlar\u0131nda bah\xe7e yoksa saks\u0131 ve toprakla da u\u011fra\u015fabilirsin.\n\t\n  Yak\u0131nlarda parasal anlamda kazan\xe7 sa\u011flamaya ba\u015flayacaks\u0131n. Tahmin etti\u011finden biraz daha y\xfcksek bir kazan\xe7 olacak.\n"
else if(r==="51")r="  Daha \xf6nce ald\u0131\u011f\u0131n riskler sana kazan\xe7 olarak bu d\xf6nemde geri d\xf6necek.\n\t\n  Ba\u015far\u0131lar\u0131n\u0131n top yapt\u0131\u011f\u0131 ve geli\u015fim g\xf6sterdi\u011fin g\xfczel bir d\xf6neme giri\u015f yap\u0131yorsun. Bunlar\u0131n yan\u0131 s\u0131ra yard\u0131mseverli\u011fin sana kar\u015f\u0131 evrende ne kadar b\xfcy\xfck bir rol oynad\u0131\u011f\u0131n\u0131 g\xf6receksin.\n\t\n  Ancak ortak yap\u0131lan i\u015flerde ve etkinlerde biraz sorun ya\u015fanabilir. Buna mutlaka dikkat etmelisin.\n"
else if(r==="52")r="  Vazge\xe7i\u015flerin a\u011f\u0131r bast\u0131\u011f\u0131 bir d\xf6neme giriyorsun. Yeni anlamlar ve ama\xe7lar pe\u015fine d\xfc\u015feceksin.\n\t\n  Ailevi konular bu d\xf6nemde senin i\xe7in \xf6nemsizle\u015fmeye ba\u015flayacak ve biraz geride kalacak. \u0130li\u015fkilerin zay\u0131flayabilir hatta kopma noktas\u0131na gelebilir. Bunlara \xe7ok dikkat etmelisin.\n\t\n  Toplum taraf\u0131ndan kurulan kurallara biraz ters d\xfc\u015febilir, bu nedenle yeni aray\u0131\u015flar i\xe7erisine girebilirsin. Ancak sonradan pi\u015fman olaca\u011f\u0131n kararlar almad\u0131\u011f\u0131ndan ve etraf\u0131nda senin i\xe7in de\u011ferli olan ki\u015fileri \xfczmedi\u011finden emin olmal\u0131s\u0131n.\n"
else if(r==="53")r="  Bu kart g\xfcc\xfc ve ba\u015far\u0131y\u0131 sembolize etmektedir.\n\t\n  Kar\u015f\u0131na bu d\xf6nemde ufak tefek zorluklar \xe7\u0131kabilir ancak sen hepsinin \xfcstesinden \xe7ok iyi bir \u015fekilde geleceksin.\n\t\n  Ayr\u0131ca ba\u015far\u0131ya ula\u015fmak i\xe7in kurgusal planlara ya da karma\u015f\u0131kl\u0131\u011fa hi\xe7 ihtiya\xe7 duymayacaks\u0131n. Zihnindeki basit planlarla tamam\u0131n\u0131 alt edebilirsin.\n\t\n  Aksine bu d\xf6nemde d\xfcr\xfcstl\xfck ve adaletli olmak senin en b\xfcy\xfck silahlar\u0131n olacak bu y\xfczden do\u011frular\u0131 s\xf6ylemekten sak\u0131n \xe7ekinme.\n"
else if(r==="54")r="  Bu kart g\xfczel m\xfcjdelerin habercisi olarak bilinmektedir.\n\t\n  G\xfczel bir kariyer, yeni bir i\u015f, \xf6nemli bir g\xfcn\xfcn y\u0131l d\xf6n\xfcm\xfc hatta do\u011fum habercisi olarak kar\u015f\u0131m\u0131za \xe7\u0131k\u0131yor.\n\t\n  Ancak en bilindik yan\u0131 ciddi ili\u015fkilerdir.\n\t\n  Yeni ciddi bir ili\u015fkiye ba\u015flayabilir veya mevcuttaki ili\u015fkinde ni\u015fan, evlilik gibi ciddi kararlar alabilirsin.\n\t\n  Sadece a\u015fk hayat\u0131nda de\u011fil sosyal \xe7evrende de ciddi ve sa\u011flam bir arkada\u015fl\u0131k ili\u015fkisiyle \xe7evrendeki insanlar\u0131 do\u011fru se\xe7ebileceksin.\n"
else if(r==="55")r="  Daha \xf6nceki deneyimlerinden edindi\u011fin tecr\xfcbeler nedeniyle \xe7ok temkinli ilerledi\u011fin bir d\xf6neme giriyorsun.\n\t\n  \xd6yleki savundu\u011fun \u015feyler i\xe7in s\xf6zl\xfc tart\u0131\u015fmaya girmek i\xe7in hi\xe7 \xe7ekinmiyorsun.\n\t\n  Ancak hen\xfcz \xe7\xf6zemedi\u011fin ve savunmaya devam etti\u011fin bir konu varsa hala \xe7\xf6zemedi\u011fin i\xe7in dikkatli olmal\u0131s\u0131n.\n\t\n  Ayr\u0131ca bu aralar ge\xe7mi\u015fteki bir rahats\u0131zl\u0131\u011f\u0131n tekrarlayabilir ya da ge\xe7mi\u015f ili\u015fkinde bir uyanma olabilir. Bunlar i\xe7in haz\u0131rl\u0131kl\u0131 olmal\u0131, \xf6nlem almal\u0131d\u0131r.\n"
else if(r==="56")r="  Giri\u015fimlerinizdeki ini\u015fler ve \xe7\u0131k\u0131\u015flar ya\u015fad\u0131\u011f\u0131n\u0131z bir d\xf6neme girebilirsiniz. Ancak buna ra\u011fmen baz\u0131 konularda \u0131srarc\u0131 olabilirsiniz.\n\t\n  Bu d\xf6nemde neyin hatal\u0131 oldu\u011funu fark edip buna \xe7\xf6z\xfcm bulmaya \xf6zen g\xf6stermelisiniz. Aksi halde ini\u015fli \xe7\u0131k\u0131\u015fl\u0131 giri\u015fim halinden \xe7\u0131kamayabilirsiniz.\n\t\n  Ayr\u0131ca bu d\xf6nemde \xe7ok \u0131srarc\u0131 olup i\u015fi inada bindirme e\u011filiminde olacaks\u0131n. Bu inat \xe7ok iyi sonu\xe7lar do\u011furmayabilir.\n"
else if(r==="57")r="  Bu kart kendi kararlar\u0131n\u0131 mant\u0131kl\u0131 bir \u015fekilde ald\u0131\u011f\u0131n\u0131 ve hatta \xe7evrendeki insanlara da bir o kadar destek oldu\u011funu g\xf6stermektedir.\n\t\n  Ancak ak\u0131l vermek olduk\xe7a riskli bir i\u015ftir. Bunu yaparken tamamen emin oldu\u011fun konularda ak\u0131l verdi\u011finden ve \xe7ok bilmi\u015f g\xf6r\xfcnmemek i\xe7in akl\u0131 sadece ger\xe7ekten ihtiyac\u0131 olanlara ya da sana soranlara verdi\u011finden emin olmal\u0131s\u0131n.\n\t\n  Bu d\xf6nemlerde sen de e\u011fer baz\u0131 konularda \xe7\u0131kmaza girersen sadece \xe7ok g\xfcvenilir ki\u015filerden ak\u0131l almaya dikkat etmelisin.\n"
else if(r==="58")r='"\n  Psikolojik olarak iyi olmayaca\u011f\u0131n bir d\xf6neme giriyorsun. Bunal\u0131m, paranoya gibidi durumlar ba\u015f g\xf6sterebilir. Sorunlar\u0131n kayna\u011f\u0131 duygusal olarak ciddi anlamda ba\u011fl\u0131 oldu\u011fun ve seni \xe7ok kolay bir \u015fekilde etkileyecek biridir.\n\t\n  \xd6zellikle sana kar\u015f\u0131 at\u0131lacak iftiralara ve su\xe7lamalara haz\u0131rl\u0131kl\u0131 olmal\u0131, bu durumlara kar\u015f\u0131 kendini dirayetli bir \u015fekilde savunmal\u0131s\u0131n.\n\t\n  Bu durumlara kar\u015f\u0131 g\xf6sterece\u011fin en ufak zay\u0131fl\u0131k kendini sorgulamana hatta \xf6zg\xfcveninde b\xfcy\xfck y\u0131k\u0131mlara sebep olabilir.\n'
else if(r==="59")r="  Bu d\xf6nemde ger\xe7ek hayattan biraz uzakla\u015f\u0131p hayal d\xfcnyas\u0131nda ya\u015fama konusunda \u0131srarc\u0131 bir hal al\u0131yor gibisin.\n\t\n  Bu senin hayat ak\u0131\u015f\u0131n\u0131 k\xf6t\xfc anlamda etkilemekte ve isteklerine ya da ba\u015far\u0131ya ula\u015fmanda k\xf6t\xfc etki yaratmaktad\u0131r.\n\t\n  \xd6zellikle televizyon, telefon ve bilgisayar gibi teknolojik \xfcr\xfcnlere \xe7ok fazla zaman harcaman da seni hedeflerinden uzakla\u015ft\u0131r\u0131yor. \u0130\u015flerine ve hedeflerine odaklanma konusunda biraz daha istikrarl\u0131 olmal\u0131s\u0131n.\n"
else if(r==="60")r="  Hayatta kar\u015f\u0131la\u015ft\u0131\u011f\u0131n b\xfct\xfcn drama ve zorluklardan g\xfc\xe7l\xfc bir \u015fekilde \xe7\u0131k\u0131yorsun ancak. Bu aralar ba\u015f\u0131na gelebilecek k\xf6t\xfc bir olay hakk\u0131nda yine de seni uyarmak isterim.\n\t\n  Buna ek olarak \u015fu an hayat\u0131nda bulunan bir durum ya da ki\u015fiden yava\u015f yava\u015f uzakla\u015f\u0131yorsun. Bu \u015fey hayat\u0131ndan tamamen \xe7\u0131k\u0131yor.\n\t\n  Ancak korkma bu olay ya da ki\u015finin senin hayat\u0131nda olumlu veya olumsuz bir etkisi yok. Bunu kaybetmek seni eksiltmeyecektir.\n"
else if(r==="61")r="  Bu kart rekabet ve sava\u015f\xe7\u0131 ruhun duygular\u0131n\u0131 bar\u0131nd\u0131rmaktad\u0131r.\n  \n  Yak\u0131n zamanda kar\u015f\u0131na \xe7\u0131kacak olan tart\u0131\u015fma ve s\xf6zl\xfc sald\u0131r\u0131lara kar\u015f\u0131 dimdik ayakta durmal\u0131s\u0131n. \n  \n  Ayr\u0131ca bu kart aile veya i\u015f hayat\u0131nda fikir ayr\u0131l\u0131klar\u0131na d\xfc\u015fece\u011fin ve baz\u0131 anla\u015fmazl\u0131klarla kar\u015f\u0131la\u015faca\u011f\u0131n\u0131 da belirtmektedir.\n  \n  T\xfcm bunlara kar\u015f\u0131 dikkatli olmal\u0131s\u0131n.\n"
else if(r==="62")r="  Duygular\u0131nla ba\u015fa \xe7\u0131kamad\u0131\u011f\u0131n ve bu sebeple onlar\u0131 arka plana at\u0131p onlardan uzakla\u015ft\u0131\u011f\u0131n bir d\xf6neme giriyorsun.\n\t\n  \xd6zellikle karars\u0131zl\u0131klar\u0131n ba\u015f g\xf6sterdi\u011fi bu d\xf6nemde biraz dengeye ihtiya\xe7 duyacaks\u0131n. Bu y\xfczden kararlar\u0131n\u0131 ve hedeflerini biraz ertelemek isteyeceksin. \n\t\n  Bu erteleme i\u015flemini yapman senin i\xe7in do\u011fru bir karar olacakt\u0131r. \xc7\xfcnk\xfc ruhunun biraz dinlenmeye ihtiyac\u0131 olacak.\n\t\n  Bu durumu alaca\u011f\u0131n kesin bir kararla sonland\u0131r\u0131p eski hayat\u0131na geri d\xf6neceksin.\n"
else if(r==="63")r="  Bu kart\u0131n iyi bir kart oldu\u011funu s\xf6yleyemem. \xd6yleki malesef bu kart sana bir tak\u0131m olumsuzluklarla birlikte geliyor. S\xf6yleyeceklerime kulak verip hayattaki dikkat seviyesini art\u0131rmanda fayda var.\n\t\n  Fiziken veya ruhen ya\u015fayabilece\u011fin sorunlar ba\u015f g\xf6steriyor. Kazanc\u0131nda d\xfc\u015f\xfckl\xfck meydana geliyor.\n\t\n  Yak\u0131n zamanda yapt\u0131\u011f\u0131n bencilliklerinin karmas\u0131 olarak geri d\xf6nen bu kart hayat\u0131ndan baz\u0131 kay\u0131plar verece\u011fini g\xf6steriyor.\n\t\n  Uzun s\xfcredir g\xfcvendi\u011fin ve inand\u0131\u011f\u0131n \u015feylere olan duygular\u0131n\u0131 yava\u015f yava\u015f yitirmeye ba\u015fl\u0131yorsun.\n\t\n  Hayat\u0131nda \xf6nem verdi\u011fin her \u015feyi kutusunda b\u0131rak\u0131p onlar\u0131 bu k\xf6t\xfc d\xf6nemi atlatana kadar \xe7\u0131karma. Hayat\u0131ndan gidecek kay\u0131plara kar\u015f\u0131 kendini haz\u0131rla. Bu d\xf6nemde \xf6z benli\u011fini dik ve g\xfc\xe7l\xfc tutmak ayr\u0131ca evrene pozitif enerji g\xf6nderip iyi dileklerde bulunmak \xe7ok \xf6nemli.\n"
else if(r==="64")r="  Aile i\xe7inde uyum ve sevgi yo\u011funlu\u011fu g\xf6r\xfcn\xfcyor. Aile ba\u011flar\u0131n\u0131 g\xfc\xe7lendirip onlarla harcad\u0131\u011f\u0131n kaliteli zamandan keyif alacaks\u0131n.\n\t\n  E\u011fer halihaz\u0131rda bir ili\u015fkin varsa bunu evlilik veya ni\u015fan ile destekleyebilirsin.\n\t\n  Arkada\u015fl\u0131k ili\u015fkilerinde ise ortakl\u0131\u011fa gidebilir g\xfczel i\u015fler ba\u015farabilirsin.\n\t\n  \u0130\xe7inde bulundu\u011fun olumlu durumlar varl\u0131\u011f\u0131n\u0131 s\xfcrd\xfcrmeye devam edecek.\n"
else if(r==="65")r="  Bu kart sana duygular d\xfcnyas\u0131nda ne kadar g\xfczel ve \xf6zellikle kar\u015f\u0131l\u0131kl\u0131 g\xfcnlerin seni bekledi\u011fini ifade ediyor.\n\t\n  Bekledi\u011fin bir ki\u015fiden kar\u015f\u0131l\u0131k alabilir ya da hayat\u0131ndaki ki\u015fi i\xe7in i\xe7indeki ate\u015fte b\xfcy\xfck oranda y\xfckselme olabilir.\n\t\n  Bu kart ayn\u0131 zamanda sanat yetene\u011fini de g\xf6stermektedir. Sanata olan ilgindeki art\u0131\u015f ile g\xfczel i\u015fler ba\u015faracaks\u0131n ancak bu konuda disiplini elden b\u0131rakmaman gerekiyor.\n"
else if(r==="66")r="  \xc7ok fazla vaat vererek kapasitenin \xfcst\xfcnde bir i\u015fe giri\u015fmi\u015fsin ya da giri\u015fmek \xfczeresin. Bu aralar kendini \xf6ne \xe7\u0131karmak i\xe7in \xe7ok fazla i\u015f yapmaya ve verilen her i\u015fi kabul etmeye \xe7al\u0131\u015f\u0131yorsun.\n\t\n  Bu h\u0131rs\u0131n ve \xe7aban sana ba\u015far\u0131s\u0131zl\u0131k olarak d\xf6nebilir ya da kar\u015f\u0131l\u0131\u011f\u0131 beklentilerini kar\u015f\u0131lamayabilir. Kapasitenin yetti\u011fi kadar i\u015f yapmaya ve o i\u015flerde g\xf6sterdi\u011fin ba\u015far\u0131yla kendini \xf6ne \xe7\u0131karman daha do\u011fru olabilir.\n\t\n  \u0130skelet yap\u0131nda ya da kalbinde bir sa\u011fl\u0131k sorunu ile kar\u015f\u0131la\u015fabilirsin. Bunlar\u0131n nedeni i\u015f y\xfck\xfcn olabilir. Dikkatli olmal\u0131s\u0131n.\n"
else if(r==="67")r="  \xc7ok yorgun g\xf6r\xfcn\xfcyorsun. Bu d\xf6nemde biraz kabu\u011funa \xe7ekilmek isteyecek, d\xfcnyevi e\u011flencelerden ve duygulardan biraz ka\xe7\u0131nacaks\u0131n. \n\t\n  \xd6zellikle yeni ortamlar ve \xe7evreler senin kabusun olmaya ba\u015flayacak.\n\t\n  Bu d\xf6nemde kendini \xe7ok yormamaya \xf6zen g\xf6stermen ve dinlenmeye \xe7ekilmen olduk\xe7a ak\u0131ll\u0131ca bir karar olacakt\u0131r.\n\t\n  Bu durum mevcut i\u015f ve sosyal hayat\u0131n\u0131 da g\xf6zden ge\xe7irmen i\xe7in sana bir f\u0131rsat sunacak.\n"
else if(r==="68")r="  Bu aralar ya\u015fayaca\u011f\u0131n kay\u0131plar\u0131n ve ka\xe7\u0131raca\u011f\u0131n f\u0131rsatlar\u0131n arkas\u0131ndan olduk\xe7a \xfcz\xfclecek hatta bunal\u0131ma girme e\u015fi\u011fine geleceksin.\n  \n  Ancak bunu yaparken elindeki de\u011ferlere odaklanmal\u0131 ve mevcutta bulunanlar\u0131 daha \xe7ok geli\u015ftirmeye \xe7al\u0131\u015fmal\u0131s\u0131n.\n  \n  Kay\u0131plar ac\u0131 olabilir ancak bunlar\u0131n \xfcstesinden kolayca gelebilecek g\xfcce sahipsin.\n"
else if(r==="69")r="  Bu kart tamamen senin ki\u015fisel aray\u0131\u015flar\u0131na g\xf6re \u015fekillenmektedir. E\u011fer aray\u0131\u015flar\u0131n ki\u015fisel geli\u015fim ve hedeflere ula\u015fma y\xf6n\xfcndeyse bu kart olumlu bir kartt\u0131r.\n\t\n  Ancak e\u011fer rahatlama ve d\xfcnyevi dertleri yenmek yerine onlardan uzakla\u015fma aray\u0131\u015f\u0131ndaysan senin i\xe7in y\u0131k\u0131c\u0131 bir kart olabilir.\n\t\n  K\xf6t\xfc ve yoldan \xe7\u0131kar\u0131c\u0131 al\u0131\u015fkanl\u0131klar, g\xfc\xe7l\xfcklerle dolu g\xfcnlere sebep olabilir. Bunlardan seni kurtarabilecek tek \u015fey iraden ve h\u0131rs\u0131nd\u0131r.\n\t\n  Bu kart ayn\u0131 zamanda sa\u011fl\u0131k problemleri ya\u015fayabilece\u011fini de g\xf6steriyor bu aralar kendine dikkat etmende fayda var.\n"
else if(r==="70")r="  Ba\u015far\u0131s\u0131zl\u0131k hissi bu aralar ortaya \xe7\u0131kacak. Mevcutta var olandan memnun olmama ve tatminsizlik duygular\u0131 olduk\xe7a g\xfc\xe7leniyor.\n\t\n  Elindeki materyalleri kaybediyor olabilirsin. Bunlar\u0131 kaybetmemek i\xe7in \xe7aba sarf etmen gerekir.\n\t\n  Ya da i\xe7indeki hisler seni daha y\xfcksek kariyere ve ba\u015far\u0131ya itti\u011fi i\xe7in bu duygular ortaya \xe7\u0131k\u0131yor olabilir. \xc7al\u0131\u015fmak bu duygular\u0131n\u0131 bast\u0131rmak i\xe7in iyi bir yol gibi g\xf6r\xfcn\xfcyor.\n"
else if(r==="71")r="  Bu aralar kazan\xe7 ve manevi anlamda yapt\u0131\u011f\u0131n yat\u0131r\u0131mlar\u0131n kar\u015f\u0131l\u0131\u011f\u0131n\u0131 al\u0131p feraha \xe7\u0131k\u0131yor gibisin.\n\t\n  Ancak bu yat\u0131r\u0131m\u0131 sadece maddi olarak d\xfc\u015f\xfcnme. Bir ki\u015fiye yapt\u0131\u011f\u0131n manevi yat\u0131r\u0131m hatta bir ki\u015finin e\u011fitimine yapt\u0131\u011f\u0131n yat\u0131r\u0131mlar da sana katlanarak geri d\xf6n\xfcyor.\n\t\n  B\xf6ylece hem manevi hem de maddi anlamda kazan\xe7 sa\u011flam\u0131\u015f olacaks\u0131n.\n"
else if(r==="72")r="  Becerilerinin nihayet kar\u015f\u0131l\u0131\u011f\u0131n\u0131 alabilece\u011fin bir d\xf6neme giriyorsun.\n\t\n  Yeteneklerinle yapt\u0131\u011f\u0131n i\u015flerden olduk\xe7a iyi kazan\xe7lar elde edeceksin. \xd6yleki bu yetenekler seni \xfcn sahibi bile yapacak gibi duruyor.\n\t\n  Kariyer anlam\u0131nda tan\u0131nman s\xf6z konusu olacak. Yapt\u0131\u011f\u0131n i\u015fle ilgili \xe7evren taraf\u0131ndan olduk\xe7a tan\u0131nacak ve ihtiya\xe7 duyulacak biri haline geliyorsun.\n"
else if(r==="73")r="  Ko\u015fullar\u0131n sa\u011flamla\u015f\u0131p i\u015flerin yoluna girmeye ba\u015fl\u0131yor.\n\t\n  \xd6zellikle bu d\xf6nemde akl\u0131ndaki kararl\u0131l\u0131k ve i\u015flerine kar\u015f\u0131 g\xf6sterdi\u011fin disiplin ile hassasiyet seni mutlak ba\u015far\u0131ya g\xf6t\xfcr\xfcyor.\n\t\n  Bu d\xf6nemde hayat\u0131ndaki ya\u015fam tarz\u0131nda ciddi ge\xe7i\u015f olacak. Bu ge\xe7i\u015f bekarl\u0131ktan evlili\u011fe, i\u015fsizlikten iyi bir i\u015f sahibi olmaya kadar bir\xe7ok alan\u0131 i\xe7eriyor.\n"
else if(r==="74")r="  Bu kart sana hayattaki de\u011fi\u015fimlerin sonsuz oldu\u011funu belirtmektedir.\n\t\n  Ya\u015fam\u0131n\u0131 g\xf6zden ge\xe7irdi\u011finde baz\u0131 konular\u0131n tekrar etti\u011fini g\xf6receksin. Bunlar maddi s\u0131k\u0131nt\u0131lar ya da sa\u011fl\u0131k s\u0131k\u0131nt\u0131lar\u0131 olabilir.\n\t\n  \u0130\u015fte bunlar\u0131n tamam\u0131 bu ya\u015fam d\xf6ng\xfcs\xfcn\xfcn i\xe7erisindedir.\n\t\n  Ald\u0131\u011f\u0131n kararlar ve at\u0131ld\u0131\u011f\u0131n risklerle \xf6n\xfcnde a\xe7\u0131lan yeni kap\u0131lar da bu de\u011fi\u015fimin i\xe7indedir.\n\t\n  Bu y\xfczden maddi anlamda tutumlulu\u011funu elden b\u0131rakmayarak kendini yeni sorunlara haz\u0131rlarken alabilece\u011fin risk adedini de art\u0131rm\u0131\u015f olacaks\u0131n.\n"
else if(r==="75")r="  Beyleyi\u015flerin, umutlar\u0131n ve \xf6zlemlerin ger\xe7ekle\u015fme yolunda ilerliyor. Yak\u0131n zamanda b\xfct\xfcn bu sayd\u0131klar\u0131m\u0131n son bulma ihtimali \xe7ok y\xfcksek.\n\t\n  Spor gib fiziksel bir aktiviteye y\xf6nelebilirsin. Bunun yan\u0131 s\u0131ra a\u015fk anlam\u0131nda bir ba\u011fl\u0131l\u0131k ya\u015faman da s\xf6z konusu.\n\t\n  T\xfcm bunlar\u0131n d\u0131\u015f\u0131nda u\xe7akla uzun bir yolculu\u011fa \xe7\u0131k\u0131yor gibi g\xf6r\xfcn\xfcyorsun. Keyfini \xe7\u0131karmaya bak.\n"
else if(r==="76")r="  Ruhunun ve sezgilerinin uyand\u0131\u011f\u0131 bir d\xf6neme giriyorsun.\n\t\n  \u0130\xe7 sesine hi\xe7 olmad\u0131\u011f\u0131 kadar g\xfcvenmeli ve \xf6nemli kararlarda d\u0131\u015far\u0131daki ki\u015filere kulak vermeden i\xe7 sesinle hareket etmelisin.\n\t\n  Art\u0131k ki\u015fisel geli\u015fimde u\xe7 noktalara geldi\u011fin ve korkular\u0131ndan ar\u0131nd\u0131\u011f\u0131n bir d\xf6nemdesin.\n\t\n  Bir kurtulu\u015fu kutlayacaks\u0131n. Bu kurtulu\u015f bir ki\u015fi ya da bir olay olabilir. Ancak nihai hedefine ula\u015fm\u0131\u015f olman bu d\xf6nemin ana konular\u0131ndan biridir.\n"
else r=r==="77"?"  \xd6zel bir g\xfcn\xfcn kutlamas\u0131 ya da evinde yapaca\u011f\u0131n k\xfc\xe7\xfck bir e\u011flence toplanmas\u0131 bu d\xf6nemde senin y\xfcz\xfcn\xfc g\xfcld\xfcr\xfcyor.\n\t\n  \xc7ocukluk an\u0131lar\u0131n ve g\xfczel d\xfc\u015f\xfcnceler bu d\xf6nemde akl\u0131ndan ge\xe7ecek. Baz\u0131 konularda ge\xe7mi\u015fi g\xf6rerek fikir de\u011fi\u015fiklikleri yapabileceksin.\n\t\n  Duygusal ve ailevi a\xe7\u0131dan durumlar tam olarak ray\u0131na oturuyor. Sosyal huzur bu aralar tamamen seninle olacak.\n":"  G\xfczel bir haber alacak gibi duruyorsun. Sab\u0131rlar\u0131n\u0131n m\xfckafat\u0131n\u0131 bu d\xf6nemde iyi bir \u015fekilde alacak gibisin.\n\t\n  Bu haber fiziki kar\u015f\u0131l\u0131\u011f\u0131 olan bir haber olacak. Bekledi\u011fin bir i\u015f teklifi, m\xfclkiyet sahibi olma hatta bir ev ya da araba sat\u0131n almaya kadar uzanmaktad\u0131r.\n\t\n  Gelecek olan g\xfczel haberi evdene g\xfczel mesajlar vererek ve ba\u011f\u0131\u015f yaparak kutlayabilirsin.\n"
